pragma solidity ^0.5.16;

contract attendanceTracker {

    mapping(address => bool) attendees;
     address[] public attendeesAddress;
    
    function addAttendee() external {
        attendeesAddress.push(msg.sender);
        attendees[msg.sender] = true;
    }

    function checkAttendee(address  _address) view external returns(bool) {
        return attendees[_address];
    }
    
    function getAttendeeCount() view external returns(uint) {
        return attendeesAddress.length;
    }

    function getStringArray() view external returns (address[] memory) {
        return attendeesAddress;
    }
    
    function resetAttendance() public {
        
        for (uint i=0; i<= attendeesAddress.length ; i++){
            attendees[attendeesAddress[i]] = false;
            attendeesAddress.pop();
        }
        
    }

}
